description:
Op deze dvd staan wederom 2 superspannende avonturen voor maar liefst 50 minuten gegarandeerd kijkplezier.

In Yeti de verschrikkelijke sneeuwman horen Uniqua, Tasha en Tyrone vreemde geluiden, als ze op onderzoek uitgaan
vinden ze rozijntjes en sneeuwbuiken waardoor Tasha denkt te weten waar de geluiden vandaan komen. De spannende speurtocht leidt de vriendjes tot diep in het bevroren Noorden waar ze een iglo met een wel heel vreemde bewoner vinden. 

In het ijspaleis beleven de vriendjes wederom een avontuur in de sneeuw. In het ruige Yukon gebergte zijn Pablo en Tyrone moedige mounties die hun sneeuwfort moeten verdedigen tegen indringers. Tasha en Uniqua zijn reddingswerkers en zij denken hulpgeroep vanuit het fort te horen maar ze komen op geen mogelijkheid binnen. Als het ze dan uiteindelijk toch lukt ontstaat er een sneeuwige verwarring!!

